css:
@font-face {
  font-family: 'Octicons Regular';
  src: url("octicons.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}
html,
body {
  width: 100%;
  height: 100%;
  overflow: hidden;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  font-size: 11px;
}
h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
}
.workspace {
  height: 100%;
  overflow: hidden;
  position: relative;
  background-color: #333333;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
}
.workspace .horizontal {
  display: -webkit-flex;
  height: 100%;
}
.workspace .vertical {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-flow: column;
}
.nav > li > a {
  border-radius: 2px;
}
.nav > li > a:hover {
  background-color: rgba(255, 255, 255, 0.07);
}
.nav.nav-pills > li.active > a {
  background-color: #4182c4;
}
.btn {
  color: #aaaaaa;
  border-radius: 2px;
  border: none;
  text-shadow: none;
  height: 27px;
  line-height: 25px;
  padding: 0 10px;
  font-size: 11px;
  z-index: 0;
  background-color: #43484d;
}
.btn:hover {
  background-color: #4f555b;
}
.btn.selected,
.btn.selected:hover {
  z-index: 1;
  background-color: #5c6064;
}
.btn.btn-xs,
.btn-group-xs > .btn {
  padding: 2.5px 5px;
  font-size: 9px;
  height: auto;
  line-height: 1.3em;
}
.btn.btn-sm,
.btn-group-sm > .btn {
  padding: 2.5px 5px;
  height: auto;
  line-height: 1.3em;
}
.btn.btn-lg,
.btn-group-lg > .btn {
  font-size: 13px;
  padding: 8px 12px;
  height: auto;
  line-height: 1.3em;
}
.btn-group > .btn {
  border-left: 1px solid rgba(0, 0, 0, 0.5);
  border-right: 1px solid rgba(0, 0, 0, 0.5);
}
.btn-group > .btn:first-child {
  border-left: none;
  border-top-left-radius: 2px;
  border-bottom-left-radius: 2px;
}
.btn-group > .btn:last-child,
.btn-group > .btn.selected:last-child,
.btn-group > .dropdown-toggle {
  border-right: none;
  border-top-right-radius: 2px;
  border-bottom-right-radius: 2px;
}
.btn-toolbar > .btn-group {
  float: none;
  display: inline-block;
}
.btn-toolbar > * {
  margin-right: 0;
  margin-left: 5px;
}
.btn-toolbar > *:first-child {
  margin-left: 0;
}
.icon:before {
  margin-right: 5px;
}
a.icon,
button.icon {
  text-decoration: none;
  color: #aaaaaa;
}
a.icon:hover,
button.icon:hover {
  color: #ffffff;
}
a {
  cursor: pointer;
  color: #ffffff;
}
a:hover {
  color: #ffffff;
  text-decoration: underline;
}
.panes {
  display: -webkit-flex;
  -webkit-flex: 1;
}
.panes .pane-column {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
}
.panes .pane-row {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: row;
}
.panes .pane {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
  overflow: hidden;
}
.panes .pane .item-views {
  -webkit-flex: 1;
  display: -webkit-flex;
  min-height: 0;
  min-width: 0;
  position: relative;
}
.panes .pane .item-views .pane-item {
  color: #aaaaaa;
  background-color: #292c2f;
}
.panes .pane .item-views > *,
.panes .pane .item-views > .react-wrapper > * {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
.panel {
  border-radius: 0;
  border: none;
  background-color: transparent;
  box-shadow: none;
}
.panel.bordered .panel-heading {
  border-radius: 2px 2px 0 0;
}
.inset-panel .panel-heading {
  border-radius: 2px 2px 0 0;
}
.panel-heading {
  margin: 0;
  border-radius: 0;
  font-size: 11px;
  line-height: 1;
}
.panel-heading .btn {
  height: 20px;
  line-height: 20px;
  font-size: 9px;
  position: relative;
  top: -5px;
}
section,
.section {
  position: relative;
  margin-top: 0;
}
section:last-child,
.section:last-child {
  margin-bottom: 0;
}
section.bordered,
.section.bordered {
  margin: 0;
  padding: 20px 0;
  border-top: 1px solid rgba(255, 255, 255, 0.07);
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
}
section .section-heading:first-child,
.section .section-heading:first-child {
  margin-top: 0;
  font-weight: bold;
  color: #ffffff;
}
div > section:first-child,
form > section:first-child,
div > .section:first-child,
form > .section:first-child {
  border-top: none;
  padding-top: 0;
}
div > section:last-child,
form > section:last-child,
div > .section:last-child,
form > .section:last-child {
  border-bottom: none;
  padding-bottom: 0;
}
.overlay {
  position: absolute;
  left: 50%;
  width: 500px;
  margin-left: -250px;
  z-index: 9999;
  box-sizing: border-box;
  background-color: #fff;
  padding: 10px;
}
.overlay h1 {
  margin-top: 0;
  color: #ffffff;
  font-size: 1.6em;
  font-weight: bold;
}
.overlay h2 {
  font-size: 1.3em;
}
.overlay .editor.mini {
  margin-bottom: 10px;
}
.overlay .message {
  padding-top: 5px;
  font-size: 11px;
}
.overlay.mini {
  width: 200px;
  margin-left: -100px;
  font-size: 12px;
}
.overlay.from-top {
  top: 0;
  border-top: none;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
.overlay.from-bottom {
  bottom: 0;
  border-bottom: none;
  border-bottom-left-radius: 0;
  border-bottom-right-radius: 0;
}
.overlay.floating {
  left: auto;
}
.list-group,
.list-group .list-group-item {
  background-color: transparent;
  border: none;
  padding: 0;
  margin: 0;
  position: static;
}
.list-group,
.list-tree {
  margin: 0;
  padding: 0;
  list-style: none;
  cursor: default;
}
.list-group li:not(.list-nested-item),
.list-tree li:not(.list-nested-item),
.list-group li.list-nested-item > .list-item,
.list-tree li.list-nested-item > .list-item {
  line-height: 25px;
  text-wrap: none;
  white-space: nowrap;
}
.list-group .selected:before,
.list-tree .selected:before {
  content: '';
  background-color: #4182c4;
  position: absolute;
  left: 0;
  right: 0;
  height: 25px;
}
.list-group .selected > *,
.list-tree .selected > * {
  position: relative;
}
.list-group .icon:before,
.list-tree .icon:before {
  margin-right: 5px;
  position: relative;
  top: 1px;
}
.list-group .no-icon,
.list-tree .no-icon {
  padding-left: 21px;
}
.list-tree .list-nested-item > .list-tree > li,
.list-tree .list-nested-item > .list-group > li {
  padding-left: 21px;
}
.list-tree.has-collapsable-children li.list-item {
  margin-left: 17px;
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-group,
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-tree {
  display: none;
}
.list-tree.has-collapsable-children .list-nested-item > .list-item:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 12px;
  width: 12px;
  height: 12px;
  content: "\f0a3";
}
.list-tree.has-collapsable-children .list-nested-item > .list-item:before {
  position: relative;
  top: -1px;
  margin-right: 5px;
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 12px;
  width: 12px;
  height: 12px;
  content: "\f078";
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item:before {
  left: 1px;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li {
  padding-left: 17px;
}
.list-tree.has-collapsable-children .has-flat-children li.list-item,
.list-tree.has-collapsable-children.has-flat-children li.list-item {
  margin-left: 0;
}
.select-list.popover-list {
  width: 200px;
  min-width: 200px;
  margin-left: 0;
  position: relative;
}
.select-list.popover-list ol.list-group {
  position: relative;
  overflow-y: scroll;
  max-height: 200px;
}
.notification {
  position: absolute;
  top: 40px;
  left: 50%;
  margin-left: -5%;
  z-index: 9999;
  border: 2px solid rgba(0, 0, 0, 0.2);
  border-radius: 5px;
  box-shadow: inset 1px 1px 0 rgba(255, 255, 255, 0.05), 0 0 5px rgba(0, 0, 0, 0.5);
  background: -webkit-linear-gradient(rgba(20, 20, 20, 0.5), rgba(0, 0, 0, 0.5));
  color: #eee;
  width: 300px;
}
.notification .content {
  padding: 10px;
  margin-left: 42px;
  box-sizing: border-box;
}
.notification .content:after {
  content: ".";
  display: block;
  clear: both;
  visibility: hidden;
}
.notification .title {
  font-size: 12px;
  font-weight: bold;
  margin-bottom: 3px;
}
.notification .message {
  font-size: 12px;
  color: #777;
}
.notification .icon {
  display: inline-block;
  font-family: 'Octicons Regular';
  font-size: 32px;
  width: 32px;
  height: 32px;
  margin-right: 5px;
  -webkit-font-smoothing: antialiased;
}
/* TODO: Full Octicon Support */
.icon-gist {
  content: "\f20e";
}
.info-messages,
.error-messages {
  margin: 0;
  padding: 0;
  list-style: none;
}
.error-messages {
  color: #cc0000;
}
ul.background-message {
  font-size: 33px;
  margin: 0;
  padding: 0;
}
ul.background-message li {
  margin: 0;
  padding: 0;
  list-style: none;
}
ul.background-message.centered {
  display: -webkit-flex;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  -webkit-align-items: center;
  text-align: center;
}
ul.background-message.centered li {
  width: 100%;
}
.source .gfm {
  -webkit-font-smoothing: antialiased;
}
.source .gfm .markup.heading {
  font-weight: bold;
}
.source .gfm .bold {
  font-weight: bold;
}
.source .gfm .italic {
  font-style: italic;
}
.source .gfm .comment.quote {
  font-style: italic;
}
.source .gfm .raw {
  -webkit-font-smoothing: subpixel-antialiased;
}
.editor.react .underlayer {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  z-index: -2;
}
.editor.react .lines {
  min-width: 100%;
}
.editor.react .cursor {
  z-index: 2;
}
.editor.react.is-focused .cursors.blink-off .cursor {
  visibility: hidden;
}
.editor.react .horizontal-scrollbar {
  position: absolute;
  left: 0;
  right: 0;
  bottom: 0;
  height: 15px;
  overflow-x: auto;
  overflow-y: hidden;
  z-index: 3;
}
.editor.react .horizontal-scrollbar .scrollbar-content {
  height: 15px;
}
.editor.react .vertical-scrollbar {
  overflow-x: hidden;
}
.editor.react .scrollbar-corner {
  position: absolute;
  overflow: auto;
  bottom: 0;
  right: 0;
}
.editor.react .scroll-view {
  overflow: hidden;
  z-index: 0;
}
.editor.react .scroll-view-content {
  position: relative;
  width: 100%;
}
.editor.react .gutter .line-number {
  white-space: nowrap;
  padding: 0 .5em;
}
.editor.react .gutter .line-number .icon-right {
  padding: 0;
  padding-left: .1em;
}
.editor {
  overflow: hidden;
  cursor: text;
  display: -webkit-flex;
  -webkit-user-select: none;
  position: relative;
  z-index: 0;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  line-height: 1.3;
}
.editor .gutter .line-number.cursor-line {
  opacity: 1;
}
.editor .gutter {
  overflow: hidden;
  text-align: right;
  cursor: default;
  min-width: 1em;
  box-sizing: border-box;
}
.editor .gutter .line-number {
  padding-left: .5em;
  opacity: 0.6;
}
.editor .gutter .line-numbers {
  position: relative;
}
.editor .gutter .line-number.folded.cursor-line {
  opacity: 1;
}
.editor .gutter .line-number .icon-right {
  display: inline-block;
  visibility: hidden;
  padding-left: .1em;
  padding-right: .5em;
  opacity: .7;
}
.editor .gutter .line-number .icon-right:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 0.8em;
  width: 0.8em;
  height: 0.8em;
  content: "\f0a3";
}
.editor .gutter:hover .line-number.foldable .icon-right {
  visibility: visible;
}
.editor .gutter:hover .line-number.foldable .icon-right:before {
  content: "\f0a3";
}
.editor .gutter:hover .line-number.foldable .icon-right:hover {
  opacity: 1;
}
.editor .gutter .line-number.folded .icon-right,
.editor .gutter:hover .line-number.folded .icon-right {
  visibility: visible;
}
.editor .gutter .line-number.folded .icon-right:before,
.editor .gutter:hover .line-number.folded .icon-right:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 0.8em;
  width: 0.8em;
  height: 0.8em;
  content: "\f078";
}
.editor .gutter .line-number.folded .icon-right:before,
.editor .gutter:hover .line-number.folded .icon-right:before {
  position: relative;
  left: -0.1em;
  content: "\f078";
}
.editor .fold-marker:after {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 0.8em;
  width: 0.8em;
  height: 0.8em;
  content: "\f09a";
  padding-left: 0.2em;
}
.editor .line.cursor-line .fold-marker:after {
  opacity: 1;
}
.editor.is-blurred .line.cursor-line {
  background: rgba(0, 0, 0, 0);
}
.editor .invisible-character {
  font-weight: normal !important;
  font-style: normal !important;
}
.editor .indent-guide {
  display: inline-block;
  box-shadow: inset 1px 0;
}
.editor .vertical-scrollbar {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  width: 15px;
  overflow-y: auto;
  z-index: 3;
}
.editor .scroll-view {
  overflow-x: auto;
  overflow-y: hidden;
  -webkit-flex: 1;
  min-width: 0;
  position: relative;
}
.editor.soft-wrap .scroll-view {
  overflow-x: hidden;
}
.editor .underlayer {
  z-index: 0;
  position: absolute;
  min-height: 100%;
}
.editor .lines {
  position: relative;
  z-index: 1;
}
.editor .overlayer {
  z-index: 2;
  position: absolute;
}
.editor .line {
  white-space: pre;
}
.editor .line span {
  vertical-align: top;
}
.editor .cursor {
  position: absolute;
  border-left: 1px solid;
}
.editor .cursor,
.editor.is-focused .cursor.blink-off {
  visibility: hidden;
}
.editor.is-focused .cursor {
  visibility: visible;
}
.cursor.hidden-cursor {
  display: none;
}
.editor .hidden-input {
  padding: 0;
  border: 0;
  position: absolute;
  z-index: -1;
  top: 0;
  left: 0;
  opacity: 0;
  width: 1px;
}
.editor .selection .region {
  position: absolute;
  pointer-events: none;
  z-index: -1;
}
.editor.mini {
  height: auto;
  line-height: 25px;
}
.editor.mini .cursor {
  width: 2px;
  line-height: 20px;
  margin-top: 2px;
}
.editor.mini .gutter {
  display: none;
}
.editor.mini .scroll-view {
  overflow: hidden;
}
.editor.mini .placeholder-text {
  color: #555555;
}
.select-list .loading .loading-message:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f09e";
}
.select-list .loading .loading-message:before {
  font-size: 1.1em;
  width: 1.1em;
  height: 1.1em;
  margin-right: 5px;
}
.select-list .loading .badge {
  margin-left: 10px;
}
.select-list ol.list-group {
  position: relative;
  overflow-y: auto;
  max-height: 312px;
  margin: 10px 0 0 0;
  padding: 0;
}
.select-list ol.list-group li {
  display: block;
}
.select-list ol.list-group li .primary-line,
.select-list ol.list-group li .secondary-line {
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.editor .lines .markup.git-commit.changed {
  color: #b58900;
}
.editor .lines .markup.git-commit.deleted {
  color: #dc322f;
}
.editor .lines .markup.git-commit.inserted {
  color: #859900;
}
:focus {
  outline: none;
}
.pull-center {
  margin-left: auto;
  margin-right: auto;
}
.padded {
  padding: 10px;
}
ul.block,
div.block {
  margin-bottom: 10px;
}
div > ul.block:last-child,
div > div.block:last-child {
  margin-bottom: 0;
}
.inline-block,
.inline-block-tight {
  display: inline-block;
  vertical-align: middle;
}
.inline-block {
  margin-right: 10px;
}
.inline-block-tight {
  margin-right: 5px;
}
div > .inline-block:last-child,
div > .inline-block-tight:last-child {
  margin-right: 0;
}
.pull-right .inline-block {
  margin-right: 0;
  margin-left: 10px;
}
.pull-right .inline-block-tight {
  margin-right: 0;
  margin-left: 5px;
}
.pull-right > .inline-block:first-child,
.pull-right > .inline-block-tight:first-child {
  margin-left: 0;
}
.error {
  -webkit-animation: flash-error 0.3s ease-in;
}
@-webkit-keyframes flash-error {
  0% {
    background: #cc0000;
  }
  100% {
    background: auto;
  }
}
.icon-alert:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f02d";
}
.icon-alignment-align:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f08a";
}
.icon-alignment-aligned-to:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f08e";
}
.icon-alignment-unalign:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f08b";
}
.icon-arrow-down:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f03f";
}
.icon-arrow-left:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
